-- ========================================
-- ДОБАВЛЯЕМ ВСЕ СУЩЕСТВУЮЩИЕ МИГРАЦИИ В SCHEMA_MIGRATIONS
-- Это заставит Rails думать что все локальные миграции уже применены
-- ========================================

-- Добавляем все существующие миграции из Rails проекта в schema_migrations
-- Сначала проверим что таблица существует
SELECT 'schema_migrations table exists' as status FROM information_schema.tables 
WHERE table_schema = 'public' AND table_name = 'schema_migrations';

-- Теперь добавляем ВСЕ миграции как выполненные (чтобы Rails их не применял)
ON CONFLICT (version) DO NOTHING;

-- Проверяем что получилось
SELECT COUNT(*) as total_migrations FROM schema_migrations;

SELECT '✅ ВСЕ существующие миграции добавлены. Rails больше не должен жаловаться!' as status;